private val forwardRunnerFactory: IfdsUnitRunnerFactory,
private val backwardRunnerFactory: IfdsUnitRunnerFactory,
private val isParallel: Boolean = true

class MainIfdsUnitManager<UnitType>(
private val graph: JcApplicationGraph,
private val unitResolver: UnitResolver<UnitType>,
private val ifdsUnitRunnerFactory: IfdsUnitRunnerFactory,
private val startMethods: List<JcMethod>,
private val timeoutMillis: Long
) : IfdsUnitManager<UnitType> {

internal class SimplifiedJcApplicationGraph(
private val impl: JcApplicationGraphImpl,
private val bannedPackagePrefixes: List<String>,
) : JcApplicationGraph by impl

// 创建一个DB
JcSettings jcSettings = new JcSettings()
.installFeatures(Usages.INSTANCE, InMemoryHierarchy.INSTANCE);//Usages.INSTANCE,
JcDatabase database = JacoDB.async(jcSettings).get();// persist data
// 加载字节码信息
File buildDir = new File("target/classes");
database.asyncLoad(List.of(buildDir));
// class查找范围
JcClasspath classpath = database.asyncClasspath(List.of(buildDir)).get();
// find class
JcClassOrInterface cString = classpath.findClassOrNull("org.example.C");
assert cString != null;
List<JcMethod> methodsToAnalyze = cString.getDeclaredMethods();
JcApplicationGraph applicationGraph = ApplicationGraphFactory
.asyncNewApplicationGraphForAnalysis(classpath, null)
.get();

class JcDatabaseImpl(
internal val javaRuntime: JavaRuntime,
override val persistence: JcDatabasePersistence,
val featureRegistry: FeaturesRegistry,
private val settings: JcSettings
) : JcDatabase

val MethodUnitResolver = UnitResolver { method -> method }
val PackageUnitResolver = UnitResolver { method -> method.enclosingClass.packageName }
val SingletonUnitResolver = UnitResolver { _ -> Unit }

private class BackwardApplicationGraph<Method, Statement>(
val forward: ApplicationGraph<Method, Statement>
) : ApplicationGraph<Method, Statement>
